      {
        company: "NNPC",
        role: "DevOps Intern",
        dateRange: "June 2024 - August 2024",
        location: "Abuja, Nigeria",
        description: "Specialized in automating JS deployments..."
      },
      // Additional roles...
    ],
    education: [
      {
        institution: "Luther College",
