    topSkills: [
      "Robotic Process Automation (RPA)",
      "JavaScript",
      "Cardiopulmonary Resuscitation (CPR)"
    ],
    certifications: [
      "Basic Life Support (BLS)",
      "Mental Health First Aid"
    ]
  };
  
  export default resumeData;
